//Navigation to career
function onRouteChanged() {
  const hash = window.location.hash;
  const routerView = document.getElementById("router-view");

  if (!(routerView instanceof HTMLElement)) {
    throw new ReferenceError("No router view element available for rendering");
  }

  if(hash !== "#careers") {
    return;
  } else {
      routerView.innerHTML = `
      <section class="contact-clean">
    <form data-bss-recipient="9dbc2e25893510eeaa3500221851d153" data-bss-subject="Resume from xxartist site form">
        <h2 class="text-center">Contact us</h2>
        <div class="form-group"><input type="text" class="form-control" name="name" placeholder="Name" /></div>
        <div class="form-group"><input type="email" class="form-control is-invalid" name="email" placeholder="Email" /></div>
        <div class="form-group"><textarea class="form-control" name="message" placeholder="Message" rows="14"></textarea></div>
        <div class="form-group"><button class="btn btn-primary" type="submit">send </button></div>
    </form>
</section>
      `;
      const back = document.createElement('a');
      back.innerText = "Back"
      routerView.appendChild(back);
      back.setAttribute("href", "http://127.0.0.1:5501/xxartist/public_html/index.html");
      const hide = document.querySelectorAll(".hide")
      hide.forEach(navItem => {
        navItem.classList.add('d-none');
      })
    }
}

window.addEventListener("hashchange", onRouteChanged);

